import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {

  return (
    <>
      <div>
        <form onSubmit={handleSubmit}>
          <label htmlFor="name"></label>
        </form>
      </div>
    </>
  );
};
